import CardList from './CardList';
import Form from './Form';
import { useState } from 'react';

function App() {

  const [professores, setProfessores] = useState([

    { name: 'Gabriel Militello', bio: 'Doutorando e Mestre em Educação: Currículo', ies: 'PUC-SP' },
    { name: 'Jonas Sousa', bio: 'Cursando pedagogia', ies: 'Mackenzie' },
    { name: 'Larissa Afonso', bio: 'Dr. em Engenharia Química', ies: 'POLI-USP' },

  ]);



  return (
    <CardList>
      {
        professores.map(({ name, bio, ies }) => <Card name={name} bio={bio} ies={ies} />)
      }
    </CardList>
  )
}

export default App;
